import React, { useContext } from 'react'
import { View, Text, TouchableOpacity, StyleSheet, Platform, StatusBar, SafeAreaView, FlatList } from 'react-native'
import HeaderAnnex from '../components/Shared/HeaderAnnex'
import { CartContext } from '../context/CartContext';

export default function OrderScreen({ navigation }) {

    const [cart, setCart] = useContext(CartContext);

    return (
        <SafeAreaView style={styles.androidSafeArea}>
            <View style={{ flex: 1 }}>
                <HeaderAnnex titleAlign="center" title="Complaints and Enquiries" />

                <FlatList
                    showsVerticalScrollIndicator={false}
                    data={cart}
                    renderItem={({ item }) =>

                        <View >

                            <View >
                                <View >
                                    <Image style={{
                                        flex: 1,
                                        resizeMode: 'cover',
                                        borderRadius: 10,
                                        height: 90,
                                        width: 80,
                                    }}
                                        imageStyle={{
                                            width: 80
                                        }}
                                        source={item.image} />
                                </View>
                                <View >
                                    <Text >{item.name}</Text>
                                    <Text >{item.description} {'\n'}{item.description2}</Text>
                                    <Text >{item.price}</Text>
                                </View>

                            </View>
                        </View>
                    }
                />

            </View>
        </SafeAreaView>
    )
}

const styles = StyleSheet.create({
    androidSafeArea: {
        flex: 1,
        paddingTop: Platform.OS === "android" ? StatusBar.currentHeight : 0,
    },
    screen: {
        marginHorizontal: 15
    }
})
